import React from 'react';
import { ThemeProvider } from '@material-ui/styles';
import Layout from './containers/Layout/Layout'
//import OrderingList from './containers/OrdersList/OrderingList'

const theme = {};

const App = () => {
  return (
    <React.Fragment>
      <ThemeProvider theme={theme}>
      <Layout>
        <div>hello</div>
      </Layout>     
      </ThemeProvider> 
    </React.Fragment>
  );
}

export default App;
